import React, { Component } from 'react'

export class Disconnect extends Component {


    render() {
        return (
            <div>
                <h1> Disconnect Component</h1>
                <button type="button" onClick={this.props.disconnect(this.socket)} >Disconnect</button>
            </div>
        )
    }
}

export default Disconnect
